import React from 'react';
import './Register.module.css';

function Register() {
  return (
      <div className="register">
          <div className="id">
            <input type="text" placeholder="아이디를 입력해주세요" className="input_id"/><button type="button" className="btn_check">중복체크</button>
          </div>

          <div className="pwd">
            <input type="password" placeholder="비밀번호를 입력해주세요" className="input_pwd1"/><br/>
            <input type="password" placeholder="비밀번호를 재입력해주세요" className="input_pwd2"/>
            <span className="span_pwd"></span>
          </div>

          <div className="nickname">
            <input type="text" placeholder="닉네임을 입력해주세요(2~12글자)" className="input_nick"/>
            <span className="span_nick"></span>
          </div>
          
          <button type="submit" className="submit">회원가입</button>
      </div>
  );
}

export default Register;
